import React from 'react'

const Footer = () => {
  return (
    <div id="footer" className='bg-gradient w-full max-h-[400px] p-4'>
      <div className="container m-auto grid grid-cols-4">
        <div className="footer-logo">
          <img src="assets/images/logo.jpeg" className='h-32 w-32' alt="" />
        </div>
      </div>
    </div>
  )
}

export default Footer
